import React from 'react';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Typewriter from 'typewriter-effect';

const useStyles = makeStyles((theme)=>({
  root: {
    width: '100%',
    backgroundImage: `url(${"/assets/bg1.png"})`,
    backgroundSize:'cover',
    padding:24,
    height:'100vh',
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    [theme.breakpoints.down('xs')]: {
        padding:18
       },
  },
  mainHead:{
      fontWeight:600,
      marginBottom:0,
      color:'white',
    [theme.breakpoints.down('xs')]: {
       fontSize:'3.8rem'
      },
      [theme.breakpoints.up('sm')]: {
        fontSize:'4.2rem'
       },
       [theme.breakpoints.up('lg')]: {
        fontSize:'6rem'
       }
  },
  subHead:{
    color:'white',
    [theme.breakpoints.down('xs')]: {
        fontSize:'1.6rem'
       },
       [theme.breakpoints.up('sm')]: {
         fontSize:'2.125rem'
        },
        [theme.breakpoints.up('lg')]: {
         fontSize:'2.125rem'
        }
  },
  lowerHead:{
    color:'white',
  }
}));

export default function About() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
    <Typewriter
  onInit={(typewriter) => {
    typewriter.typeString('Hello World!')
      .callFunction(() => {
        console.log('String typed out!');
      })
      .pauseFor(2500)
      .deleteAll()
      .callFunction(() => {
        console.log('All strings were deleted');
      })
      .start();
  }}
/>
      <Typography variant="h1" component="h2" gutterBottom className={classes.mainHead}>
       BASIT MIR
      </Typography>
     
      <Typography variant="h4" gutterBottom className={classes.subHead}>
       I'm Software Engineer
      </Typography>
     
      <Typography variant="body1" gutterBottom className={classes.lowerHead}>
        If you can imagine it, I can make it...
      </Typography>
     
    </div>
  );
}
